import React from "react";
import "./styles.css";
import Logo from "../../assets/images/logo.png";
export default function Header() {
  return (
    <header>

    <a href="//www.google.com">
      <img className="image" alt="logo" src={Logo} />
    </a>
    </header>
  );
}
